def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.15:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2) * np.sqrt(item) / np.sqrt(bins[i])
        elif ratios[i] >= 0.15 and ratios[i] < 0.35:
            priorities[i] = np.tan(item) + np.tan(bins[i]) + np.log(np.abs(item - bins[i]) + 1)
        elif ratios[i] >= 0.35 and ratios[i] < 0.55:
            priorities[i] = np.arctan(np.sqrt(item * bins[i])) * np.cosh(np.exp(ratios[i]))
        elif ratios[i] >= 0.55 and ratios[i] < 0.75:
            priorities[i] = np.tanh(np.sqrt(ratios[i])) - np.log(ratios[i] + 1) + np.cos(item) * np.sin(bins[i])
        else:
            priorities[i] = np.sinh(ratios[i]) / np.cosh(ratios[i])**2

    return priorities
